INSERT INTO `board_faq` VALUES (1,1,'녹차 우리기','모릅니다ㄴㄴㄴ','2018-12-10 06:00:54','2018-12-10 07:34:06',NULL),(2,1,'정수기 찬 물ss','모릅니다','2018-12-10 06:01:05','2018-12-11 07:57:32',NULL),(3,1,'영수증 출력 방법','이렇게하면됩니다~~~~~~~~','2018-12-07 14:47:57','2018-12-10 07:04:02',NULL),(4,1,'ss','sssssssssssssssssssss','2018-12-10 08:33:09','2018-12-10 08:34:08','2018-12-10 08:34:08'),(5,1,NULL,NULL,'2018-12-11 01:51:45','2018-12-11 07:57:23','2018-12-11 07:57:23'),(6,1,NULL,NULL,'2018-12-11 02:17:27','2018-12-11 07:57:23','2018-12-11 07:57:23'),(7,1,'test','1','2018-12-11 07:57:43','2018-12-11 07:57:43',NULL),(8,1,'강아지수제간식~~','<p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">저희 테마파크에서는 이주일에 한번씩 강아지들의 건강을 위해 수제간식을 직접 만들어</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">배급해 주고있습니다.... 운영팀분들이 고생이 많으시죠 ㅜㅜ</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">평소에는 데코에 신경도 안쓰고 그냥 휘리릭 만들어서 배급해 주고 있지만</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">어제 저희 강아지들 생일 파티를 위해서 예쁘게 생일케이크를 만들었어요</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><span style=\"margin: 0px; border: 0px; padding: 0px; vertical-align: middle; background: transparent;\">&nbsp;</span></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><span style=\"margin: 0px; border: 0px; padding: 0px; vertical-align: middle; background: transparent;\">저희 테마파크야 강아지에 대해 전문지식을 가지신 분들이 많이 계셔&nbsp;</span><span style=\"margin: 0px; border: 0px; padding: 0px; vertical-align: middle; background: transparent;\">이런것들이 생활화 되어있지만,</span></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">강아지를 키우신지 얼마 되지 않은 반려인 분들은 강아지 간식만드는 법이 궁금하실것 같아,</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">운영팀장님과 상의해 이참에 수제간식 만드는 법을 포스팅 하기로 하였지요~</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><br></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">강아지를 오래 키우셨던 분들은 다 아실지도 모르겠지만,&nbsp;</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">사람이 먹는 음식중에 강아지에게<span style=\"margin: 0px; border: 0px; padding: 0px; vertical-align: middle; background: transparent;\">주어도 되는 음식과 주면 안돼는 음식이 있다는것 다들 아시죠??</span></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><br></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">그래서 준비했습니다! 사람과 강아지가 함께 먹을수 있는 수제간식만들기&nbsp;</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">함께 보실까요!!!!!!!!</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">출~발~</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><br></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><img src=\"http://themepark.phps.kr/editor/upload/img/1447318233.jpg\" border=\"0\" style=\"margin: 0px; border: 0px; padding: 0px; vertical-align: middle; line-height: 24px; background: transparent;\"></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><br></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">짠 오늘의 수제간식 재료는</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><span style=\"margin: 0px; border: 0px; padding: 0px; vertical-align: middle; background: transparent; color: rgb(255, 108, 0);\">닭가슴살, 단호박, 고구마, 브로콜리, 계란 노른자</span>&nbsp;입니다!!</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">위에있는 재료들은 강아지들 건강에 아주좋은 재료들인데요</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">강아지들도 사료만 먹다보면 영양 불균형이 되기 쉽기때문에 적당한 간식과&nbsp;</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">사료를 배급해 주는것이 강아지 장수의 비결이겠죠!!</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">&nbsp;&nbsp;&nbsp;</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><br style=\"clear: both;\"><img src=\"http://themepark.phps.kr/editor/upload/img/1447318298.jpg\" border=\"0\" style=\"margin: 0px; border: 0px; padding: 0px; vertical-align: middle; line-height: 24px; background: transparent;\"><br style=\"clear: both;\"><img src=\"http://themepark.phps.kr/editor/upload/img/1447318309.jpg\" border=\"0\" style=\"margin: 0px; border: 0px; padding: 0px; vertical-align: middle; line-height: 24px; background: transparent;\"></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><br></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">먼저 고구마를 박박 닦아줍니다!</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">그리고 껍질을 배껴주세요&nbsp;</p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\">(저 빠른 손놀림을보라.. 한두번 해본 솜씨가 아녀...)<br></p><p align=\"center\" style=\"border: 0px; font-size: 16px; vertical-align: middle; line-height: 18px; background: rgb(255, 255, 255); color: rgb(70, 70, 70); font-family: 돋움;\"><br></p><p align=\"c