--
-- Table structure for table `order`
--

DROP TABLE IF EXISTS `order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `users_id` int(11) DEFAULT NULL COMMENT '주문자',
  `store_id` int(11) DEFAULT NULL,
  `use_point` int(11) DEFAULT NULL COMMENT '사용 포인트',
  `number` int(11) DEFAULT NULL COMMENT '주문번호',
  `approve_type` varchar(10) DEFAULT NULL COMMENT '승인타입',
  `approve_number` varchar(50) DEFAULT NULL COMMENT '승인번호',
  `approve_date` varchar(50) DEFAULT NULL COMMENT '승인 일자',
  `card_type` varchar(50) DEFAULT NULL COMMENT '카드 종류',
  `card_no` varchar(50) DEFAULT NULL COMMENT '카드 번호',
  `count` int(11) DEFAULT NULL COMMENT '갯수',
  `price` int(11) DEFAULT NULL COMMENT '해당 주문의 총 가격',
  `supply` int(11) DEFAULT NULL COMMENT '과세금액',
  `tax` int(11) DEFAULT NULL COMMENT '부가세',
  `installments` varchar(4) DEFAULT NULL COMMENT '할부개월수',
  `status` enum('order','pay','cancel') DEFAULT NULL COMMENT '주문상태 :결제대기, 결제 완료, 결제 취소',
  `push_count` int(11) DEFAULT NULL COMMENT '호출 횟수',
  `type` enum('normal','prepayment','point') DEFAULT 'normal' COMMENT '주문 방법 : 일반,선결제,포인트결제',
  `pay_type` enum('credit','cash','prepayment','point') DEFAULT NULL COMMENT '결제방법:신용 현금 선결제,포인트결제',
  `togo` enum('Y','N') DEFAULT NULL COMMENT '매장식사 :N 포장:Y',
  `user_phone` varchar(50) DEFAULT NULL COMMENT '매장 전화',
  `print` enum('N','Y') DEFAULT 'N' COMMENT '주문 프린트 여부 (1회만 프린트 가능)',
  `confirm` enum('N','Y') DEFAULT 'N' COMMENT '포스에서 주문건 확인 여부',
  `raw_result` text DEFAULT NULL COMMENT '결제 회신내용',
  `in_cash` int(11) DEFAULT NULL COMMENT '현금결제 시 방출금',
  `out_cash` int(11) DEFAULT NULL COMMENT '현금결제 시 방출금',
  `cash_bill` enum('N','Y') DEFAULT 'N' COMMENT '현금영수증 발급 여부',
  `sign_path` varchar(260) DEFAULT NULL COMMENT '서명 이미지 위치',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=879 DEFAULT CHARSET=utf8 COMMENT='주문';
