DROP TABLE IF EXISTS `order_cashbill`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `order_cashbill` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT NULL,
  `price` int(11) DEFAULT NULL COMMENT '현금영수증 신청 금액',
  `identity_num` varchar(50) DEFAULT NULL COMMENT '신분확인번호',
  `approve_num` varchar(50) DEFAULT NULL COMMENT '승인번호',
  `status` enum('bill','cancel') DEFAULT NULL COMMENT '상태 : 발행, 취소',
  `type` varchar(50) DEFAULT NULL COMMENT '소득공제용 or 지출증빙용',
  `code` varchar(10) DEFAULT NULL COMMENT '발행코드',
  `cancel_code` varchar(10) DEFAULT NULL COMMENT '현금영수증 취소 코드 기록',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb4 COMMENT='현금영수증 내역';
