DROP TABLE IF EXISTS `store`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `store` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_users_id` int(11) DEFAULT NULL COMMENT '해당 점포 소유자 id',
  `sales_users_id` int(11) DEFAULT NULL COMMENT '해당 점포 대리점 id',
  `store_password` varchar(50) DEFAULT NULL COMMENT '키오스트 비밀번호',
  `name` varchar(50) DEFAULT NULL COMMENT '매장명',
  `ceo_name` varchar(50) DEFAULT NULL COMMENT '사장이름',
  `pay` int(11) DEFAULT NULL COMMENT '수수료',
  `logo` varchar(50) DEFAULT NULL COMMENT '매장로고',
  `main_img` varchar(50) DEFAULT NULL COMMENT '메인이미지',
  `status` enum('승인완료','승인거절','승인대기') DEFAULT '승인대기',
  `en_lang` enum('Y','N') DEFAULT 'Y' COMMENT '영문번역',
  `cn_lang` enum('Y','N') DEFAULT 'N' COMMENT '중문',
  `jp_lang` enum('Y','N') DEFAULT 'N' COMMENT '일어',
  `sound` int(11) DEFAULT NULL COMMENT '효과음 음량 조절',
  `kiosk_pay_type` enum('all','card') DEFAULT 'all' COMMENT '현금/카드 키오스크 선택',
  `store_phone` varchar(50) DEFAULT NULL COMMENT '매장 전화',
  `temp_phone` varchar(50) DEFAULT NULL COMMENT '핸드폰번호',
  `postcode1` varchar(10) DEFAULT NULL COMMENT '우편번호1',
  `address` varchar(255) DEFAULT NULL,
  `company_number` varchar(50) DEFAULT NULL COMMENT '사업자 등록번호',
  `company_number_image` varchar(255) DEFAULT NULL COMMENT '사업자 등록번호 이미지 URL',
  `bank_name` varchar(45) DEFAULT NULL,
  `bank_owner_name` varchar(45) DEFAULT NULL,
  `bank_number` varchar(50) DEFAULT NULL,
  `bank_number_image` varchar(255) DEFAULT NULL COMMENT '통상 사본 이미지 URL',
  `use` enum('Y','N') DEFAULT 'N' COMMENT '운영상태',
  `all_apply` enum('Y','N') DEFAULT 'N' COMMENT '판매여부 일괄적용',
  `point` int(11) DEFAULT NULL COMMENT '포인트 적립 비율',
  `point_first` int(11) DEFAULT NULL COMMENT '첫 적립 시 포인트',
  `point_use_over` int(11) DEFAULT NULL COMMENT '포인트 사용 조건',
  `point_use` enum('Y','N') DEFAULT 'N' COMMENT '포인트 사용 여부',
  `prepayment_use` enum('Y','N') DEFAULT 'N' COMMENT '선결제 사용 여부',
  `password_use` enum('Y','N') DEFAULT 'N' COMMENT '비밀번호 적용 여부',
  `togo_use` enum('Y','N') DEFAULT 'N' COMMENT '포장사용여부',
  `togo_price` int(11) DEFAULT NULL COMMENT '포장금액설정(할인또는추가금액)',
  `lat` varchar(50) DEFAULT NULL COMMENT '위도',
  `lng` varchar(50) DEFAULT NULL COMMENT '경도',
  `etc` text DEFAULT NULL,
  `started_at` datetime DEFAULT NULL COMMENT '영업시작시간',
  `finished_at` datetime DEFAULT NULL COMMENT '영업마감시간',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8 COMMENT='매장';
