--
-- Table structure for table `store_hopper`
--

DROP TABLE IF EXISTS `store_hopper`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `store_hopper` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NOT NULL DEFAULT 0,
  `store_id` int(11) DEFAULT NULL,
  `coin` int(11) DEFAULT 0 COMMENT '100원',
  `paper` int(11) DEFAULT 0 COMMENT '1000원',
  `status` enum('in','out') DEFAULT NULL COMMENT '상태 : 입금, 인출',
  `total_coin` int(11) DEFAULT 0 COMMENT '현재 누적 100원개수',
  `total_paper` int(11) DEFAULT NULL COMMENT '현재 누적 1000원개수',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=185 DEFAULT CHARSET=utf8 COMMENT='지폐 방출기 관리';
/*!40101 SET character_set_client = @saved_cs_client */;

