DROP TABLE IF EXISTS `store_menu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `store_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL,
  `store_menu_group_id` int(11) DEFAULT NULL,
  `sort` int(11) DEFAULT NULL COMMENT '정렬순서 저장',
  `name` varchar(50) DEFAULT NULL,
  `price` int(11) DEFAULT NULL COMMENT '메뉴 가격',
  `use` enum('Y','N') DEFAULT NULL COMMENT '사용여부',
  `contents` text DEFAULT NULL COMMENT '메뉴설명',
  `min_count` int(11) DEFAULT NULL COMMENT '최소 주문 개수',
  `image_type` enum('sample','file') DEFAULT NULL,
  `image_path` varchar(255) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=133 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

